      SELECT DISTINCT + 96 + + 2 * + col2 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT NULL NOT BETWEEN + 58 + col2 AND - ( - 70 ) * - col1;
  - name: tab1

outputs:
  - name: q8035.out
    data: |
